  `gmt_modified` datetime(0) NOT NULL COMMENT '更新时间',
  `is_deleted` int(11) NOT NULL COMMENT '是否作废1表示作废，0表示未作废',
  `sort_no` int(11) NOT NULL COMMENT '序号',
